import React from 'react';

function Navbar() {
  return (
    <nav style={{ backgroundColor: 'lightblue', padding: '10px' }}>
      <div style={{ display: 'flex', alignItems: 'center' }}>
        <h1 style={{ margin: '2px' }}>Library Management Systems</h1>
        <ul style={{ listStyleType: 'none', display: 'flex', gap: '10px', margin: 0 }}>
          <li><a href="/addAuthor">Add author</a></li>
          <li><a href="/showBooks">Book list</a></li>
        </ul>
      </div>
    </nav>
  );
}

export default Navbar;
